const readline = require("readline");
const stdin = process.stdin;
readline.emitKeypressEvents(stdin);
stdin.setRawMode(true);

stdin.on("keypress", (c, key) => {
    if (key.name == "tab" && key.shift) {
        TerminalWindow.prevWindow();
        return;
    }

    if (key.name == "q") {
        if (TerminalWindow.currentWindow instanceof X) {
            TerminalWindow.currentWindow.menuUp();
            return;
        }
    }

    if (key.name == "a") {
        if (TerminalWindow.currentWindow instanceof X) {
            TerminalWindow.currentWindow.menuDown();
            return;
        }
    }

    if (key.name == "tab") {
        TerminalWindow.nextWindow();
        return;
    }

    if (key.name == "up") {
        TerminalWindow.currentWindow.scrollUp();
        return;
    }

    if (key.name == "down") {
        TerminalWindow.currentWindow.scrollDown();
        return;
    }

    if (key.name == "left") {
        TerminalWindow.currentWindow.scrollLeft();
        return;
    }

    if (key.name == "right") {
        TerminalWindow.currentWindow.scrollRight();
        return;
    }

    if (key.name == 'c' && key.ctrl) {
        process.exit();
        return;
    }

    console.log(c, key)
});